                        new { RaceId = 22, CharityDescription = "Limbs for Life Foundation is a global nonprofit organization dedicated to providing fully-functional prosthetic care for individuals who cannot otherwise afford it and raising awareness of the challenges facing amputees. When a person becomes an amputee, they are faced with staggering emotional and financial lifestyle changes.  Fortunately, high tech prosthetic devices that restore a person’s basic skills and independence are available. Unfortunately, many amputees lack the financial resources to obtain adequate prosthetic care. Limbs for Life Foundation steps in to provide a financial bridge between low-income amputees and the quality prosthetic care needed to restore their lives.", CharityName = "Limbs for Life Foundation", Distance = 3.1, Title = "Constant Vigilance 5k" },
                        new { RaceId = 23, CharityDescription = "Hermione just wanted to do some good in the world. She was determined to make life better for House Elves working in Hogwarts Castle, and throughout the wizarding world. Her compassion for their well-being and her support of their freedom demonstrated her leadership abilities, and led to the elves joining in the fight to defend Hogwarts in the final battle of the Wizarding War. It is in this spirit that proceeds from this event went to support the Harry Potter Alliance and their Granger Leadership Academy. The Harry Potter Alliance (HPA) believes that the world needs more Hermione Grangers, and we emphatically agree.", CharityName = "Harry Potter Alliance (HPA)", Distance = 6.2, Title = "The 10K and S.P.E.W." },
