                        new { RaceId = 25, CharityDescription = "MK9R’s mission is to rescue, reunite, re-home, rehabilitate, and repair any retired working dog that has served mankind in some capacity. They believe these heroic canines have earned and deserve a good retirement, a loving home, and lifelong care. They provide retiring working dog heroes with transport, adoption facilitation, rehoming, financial assistance for life threatening medical situations, and end-of-life benefits which are currently lacking when these dogs retire after serving their country and their communities.", CharityName = "Mission K9 Rescue", Distance = 13.1, Title = "Sirius Half Marathon" },
                        new { RaceId = 26, CharityDescription = "If you think a dragon, a lake and a maze are tough, think about the difficulties of overcoming homelessness. BoMF’s mission is to revolutionize the way our society approaches homelessness. Their unique running-based model demonstrates that if an indivudual first restores confidence, strength and self-esteem, they are better equipped to tackle the road ahead and move toward jobs, homes and new lives. BoMF provides practical training and employment resources for achieving independence, an environment that promotes accountability, and a community that offers compassion and hope for all in need.", CharityName = "Back on My Feet (BoMF)", Distance = 4.0, Title = "Eternal Glory 4 Miler" },
                        new { RaceId = 27, CharityDescription = "ASOC is a global network of conservation organizations seeking to preserve the world’s last great wilderness, which belongs to all humankind. ASOC’s mission is to protect the Antarctic and Southern Ocean’s unique and vulnerable ecosystems by speaking for Antarctica and its magnificent species, from the tiniest krill to the largest blue whales.", CharityName = "Antarctic & Southern Ocean Coalition (ASOC)", Distance = 6.06, Title = "Platform 9 3/4k Year Four" },
                        new { RaceId = 28, CharityDescription = "The Quidditch Challenge supports all 2017 charity partners, with proceeds from this medal being divided evenly amongst them!", CharityName = "HRC 2017 Charity Partners", Distance = 3.1, Title = "Quidditch Challenge" },
                        new { RaceId = 29, CharityDescription = "BC/EFA helps men, women and children across the country and across the street receive lifesaving medications, health care, nutritious meals, counseling and emergency financial assistance. In the ultimate example of Transfiguration in the Muggle World, they turn love into money…and then turn money into love.", CharityName = "Broadway Cares/Equity Fights AIDS (BC/EFA)", Distance = 5.6, Title = "Nargle 9k" },
                        new { RaceId = 30, CharityDescription = "Many young people face an uncertain future simply because they are growing up in poverty. By the age of seven, children growing up in poverty are more than twice as likely as their better-off peers to be behind on expected reading levels. By the time they are in their teens, 60 percent won’t get the grades needed to go on to college or get employment after graduation. Debate Mate seeks to reverse that trend by using the power of debate to give disadvantaged young people the skills they need to become exceptional young leaders – confidence, interpersonal communication skills and higher order thinking. While starting in the UK, Debate Mate now enjoys a strong global presence, operating programs in Nepal, Africa, Jamaica, the Middle East, and the United States. They believe that every child deserves equal access to a top education, and wants the youth of today to find their voice so that they can become the leaders of tomorrow.", CharityName = "Debate Mate", Distance = 3.1, Title = "DA 5k" },
                        new { RaceId = 31, CharityDescription = "All Coalition members work to keep immigrant children and families safe and together. This is a huge undertaking, since most anti-immigrant actions affect not just individuals, but also their family members. Through the Coalition’s ‘Keeping Families Together Initiative’, members provide immigration-related services such as legal and social services to immigrants and their families.", CharityName = "Hispanic Federation and Lin-Manuel Miranda’s Immigrants: We Get the Job Done Coalition - Keeping Families Together Initiative", Distance = 3.1, Title = "Forgotten 5k" },
                        new { RaceId = 32, CharityDescription = "Toucan Rescue Ranch (TRR) focuses on the care, rehabilitation and study of Costa Rican wildlife including toucans, owls and sloths! TRR receives and cares for confiscated, sick and injured animals and then gives them a loving home with the goal of providing appropriate medical treatment, rehabilitation and then, when possible, returning them to their natural environment. HRC’s goal was to fully fund a brand new sloth rescue/reception facility in northern Costa Rica. Goats of Anarchy (GOA) is the passion of Leanne Lauricella, who left behind a successful career in New York City and has now created a sanctuary for goats with special needs, teaching the world acceptance and inclusion and inspiring others to “fight like a goat”! Specifically, HRC funded critical fencing and other important infrastructure improvements at GOA’s new facility in New Jersey.", CharityName = "Toucan Rescue Ranch and Goats of Anarchy", Distance = 13.1, Title = "Half-Giant Half Marathon" },
